import { useEffect } from 'react';
import './App.css';

function App() {

  const googlSignInCallback = (response) => {
    console.log(response)
  }

  useEffect(() => {
    google.accounts.id.initialize({
      client_id: "312061660538-mh1j9ht2g4j25nre1s9n96vmak2sitqk.apps.googleusercontent.com",
      callback: googlSignInCallback
    })

    google.accounts.id.renderButton(
      document.getElementById("googleSignInDiv"),
      {}
    )
  }, [])

  return (
    <div className="App">
      <div id='googleSignInDiv'></div>
    </div>
  );
}

export default App;
